import ContactBox from './components/Contactbox';
function App() {
  return (
    <div className="contacts">
     <ContactBox
        img= "../images/mr-whiskerson.png"
        name= "Mr. Whiskerson"
        phone= "(212) 555-1234"
        email= "mr.whiskaz@catnap.meow"
     />
     <ContactBox
      img= "../images/fluffykins.png"
