     />
     <ContactBox 
      img= "../images/mr-whiskerson.png"
      name= "Mr. Whiskerson"
      phone= "(212) 555-1234"
      email= "mr.whiskaz@catnap.meow"
     />
     <ContactBox
      img= "../images/mr-whiskerson.png"
      name= "Mr. Whiskerson"
      phone= "(212) 555-1234"
      email= "mr.whiskaz@catnap.meow"
     />
    </div>
  );
}

export default App;
